B.Ij=new A.f4("imdb","IMDb mobile app","Redesign UX/UI","This is a redesign of IMDb mobile app.  The main challenge was to understand the relationship between users and this database and how they feed each other.\n          \nThrough time the consumption habits of this type of data have changed, going through specialized magazines and newspapers until reaching experiences of interaction with virtual reality.\n          \nThe massive growth of multimedia productions, partly caused by the need for home entertainment during the COVID-19 pandemic, and the urgent need to consume information at high speed is the scenario in which IMDb is inserted.\n          \nThe redesign methodology was made following the James Garrett's 5 Elements of UX: Strategy, Scope, Structure, Skeleton, and Surface.\n          \n1. The Strategy:  Understand the needs of the user and the objective of the business by conducting a User Research (surveys, interviews, benchmarking, building user personas, user journeys and DVF model)\n          \n2. The Scope: I define the requirements. The axes to work and the tasks to fulfill were established. Pain Points and possible solutions.\n          \n3. The Structure: I build a new Information Architecture. This included testings as Card Sorting and Tree Testing.  Wireflows and Taskflows were also created at this step.\n          \n4. The Skeleton and Surface: A prototype was created to perform remote testings and finally I create of a Design System and a style guide.","cover.webp",B.ne,B.aF,B.ET,B.E7,!1,6)
