B.Im=new A.f4("marriage","Marriage 365","UX Research","In this project I worked for Eazy Design Agency as part of the UX Research team.\n              \nThe main goal was doing the research for a new mobile app for Marriage365  (this is a website specialized in consulting for couples and marriage advices)\n              \nI performed diferents task such as strategy, design, discovery and requirements.\n              \nWe conduct quantitative and qualitative research. Surveys (online, in depth, focus groups), remote interviews, gathering data and its subsequent analysis.\n              \nI also built user personas, empathy and journey maps,  revealing user needs and pain points  for better understanding the end-to-end user journey.","cover.webp",B.dV,B.aF,B.na,B.EK,!1,3)
